import React from 'react';

const Header = () => {
  return (
    <div className="header ui container">
    <div className="ui segment">
    <h1>ChowTime TV</h1>
      <i className="fas fa-utensils"></i>
      <i className="fas fa-tv"></i>
    </div>
      <div className="ui segment"></div>
    </div>
  );
}

export default Header;
